import React from 'react';

const RentContractPage = () => {
  return (
    <div className="min-h-screen bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-3xl mx-auto bg-white p-8 rounded-lg shadow-md">
        <h1 className="text-3xl font-bold text-gray-900 mb-6">
          Заключите договор ренты с надежной компанией
        </h1>

        <p className="text-lg text-gray-700 mb-8">
          Более 20-лет предоставляем лучшие условия по выплатам
        </p>

        <button className="w-full bg-blue-600 hover:bg-blue-700 text-white font-bold py-4 px-6 rounded-md text-lg mb-8 transition duration-200">
          УЗНАТЬ СУММУ РЕНТЫ ПРЯМО СЕЙЧАС
        </button>

        <div className="border-t border-gray-200 pt-6">
          <h2 className="text-2xl font-semibold text-gray-800">
            Московская городская служба ренты.
          </h2>
        </div>
      </div>
    </div>
  );
};

export default RentContractPage;
